"use strict";(self.webpackChunk=self.webpackChunk||[]).push([[8155],{8155:e=>{e.exports=JSON.parse('{"en":{"main_title":"Neoclassical","topic":"Neoclassical","years":"XVIII-XIX","description":"Neoclassical architecture is known for its high columns, majestic scale, and simplicity of design compared to the other prominent styles of its era. Harkening back to the buildings of Ancient Greece and Rome, it crested in popularity in both the United States and Europe from the middle of the eighteenth century to the early nineteenth century.","exemple1":"The Academy of Athens","exemple2":"The Capitol Building","exemple3":"Petit Trianon","exemple4":"The Rotunda"},"ua":{"main_title":"Неокласика","topic":"Неокласика","years":"XVIII-XIX","description":"Неокласична архітектура відома своїми високими колонами, величним масштабом і простотою дизайну в порівнянні з іншими видатними стилями своєї епохи. Повертаючись до будівель Стародавньої Греції та Риму, вона стала популярною в США Держави та Європа з середини ХVІІІ до початку ХІХ ст.","exemple1":"Афінська академія","exemple2":"Будівля Капітолію","exemple3":"Малий Тріанон","exemple4":"Ротонда"},"es":{"main_title":"Neoclásico","topic":"Neoclásico","years":"XVIII-XIX","description":"La arquitectura neoclásica es conocida por sus columnas altas, su escala majestuosa y su diseño simple en comparación con otros estilos destacados de su época. Remontándose a los edificios de la antigua Grecia y Roma, ganó popularidad tanto en los Estados Unidos Unidos y Europa desde mediados del siglo XVIII hasta principios del siglo XIX","exemple1":"La Academia de Atenas","exemple2":"El edificio del Capitolio","exemple3":"El pequeño trianón","exemple4":"la rotonda"},"specifical":{"image1":"the-academy-of-athens","image2":"the-capitol-building","image3":"petit-trianon","image4":"the-rotunda"}}')}}]);